import React from 'react';
import './Styles.css';

function Events() {
    return(
        <div className='mainSpace'>
            <center>
                <h1>Events</h1>
                Revature's Digest hosts a variety of events for both kids and adults alike to promote and enthuse book readers!
            </center>

            <h4>Current Events</h4>
            <h5>Barnyard Bash</h5>
            The Barnyard Bash is blahblahblah

            <h4>Past Events</h4>
            <h5>Cook 'em and book 'em</h5>
            Blahblahblahblahblah
        </div>
    )
}

export default Events;
